import React, { useState, useEffect } from 'react';
import { fetchProjects, createProject } from '../services/api';
import AddProjectModal from './AddProjectModal';

const ProjectList = () => {
  const [projects, setProjects] = useState([]);
  const [newProject, setNewProject] = useState({ name: '', client: '', startDate: '', endDate: '' });
  const [isModalOpen, setIsModalOpen] = useState(false);

  useEffect(() => {
    const getProjects = async () => {
      try {
        const data = await fetchProjects();
        setProjects(data);
      } catch (error) {
        console.error(error);
      }
    };
    getProjects();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const createdProject = await createProject(newProject);
      setProjects([...projects, createdProject]);
      setNewProject({ name: '', client: '', startDate: '', endDate: '' });
      setIsModalOpen(false);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h1>Project List</h1>
      <ul>
        {projects.map((project) => (
          <li key={project.id}>{project.name} - {project.client}</li>
        ))}
      </ul>
      <button onClick={() => setIsModalOpen(true)}>Add New Project</button>
      <AddProjectModal
        isOpen={isModalOpen}
        onRequestClose={() => setIsModalOpen(false)}
        onSubmit={handleSubmit}
        newProject={newProject}
        setNewProject={setNewProject}
      />
    </div>
  );
};

export default ProjectList;
